import React from 'react';
import logo from './logo.png'; 


function App() {
  return (
    <>
      <nav class="navbar navbar-dark bg-dark">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">
            <img src={logo} alt="" width="30" height="24" class="d-inline-block align-text-top mx-2" />
             we care.
          </a>
        </div>
      </nav>

      <h1 class="fw-bold mx-5 my-5">tell us how do you feel.</h1>


      {/*about last week - hours sleep, stressed/nervous, tired, happy, sports/relax, on scale 1to10 */}
      {/*red color . ?*/}

      <form class="w-25 mx-auto">
        <div class="form-group input-group-lg mb-3">
          <label for="formGroupExampleInput" class="h5">how many hours did you sleep today?</label>
          <input type="range" class="form-control" id="formGroupExampleInput" placeholder="Example input" />
        </div>
        <div class="form-group input-group-lg mb-3">
          <label for="formGroupExampleInput2" class="h5">Another label</label>
          <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="Another input" />
        </div>
      </form>
    </>
  )
}

export default App;
